import React from 'react';
import { Navbar } from "./Components/Navbar";
import { BrowserRouter, Router, Switch } from "react-router-dom";



function App() {
  return (
      <BrowserRouter>
          <Navbar />
          <Switch>
              <Route exact path="/" />

          </Switch>
      </BrowserRouter>
  );
}

export default App;
